import React, { useState} from "react";

export default function CardGeneral({ dicFilter, setDicFilter}) {

  const filters = { "Gender": "gender", "Experience": "total_xp", "English Level": "english_level", "Company Location": "company_location", "Education Level": "education_level", "How did you learned coding?": "coding_learn"}

  const handleClickRadio = (e) => {
    setFilter(e.target.value)
    console.log(e.target.value)
  };

  const getInitInfo = async () => {
    try {
      const response = await fetch("http://localhost:5000/by_company/");
      const jsonData = await response.json();
      setDicCompany(jsonData)
      return jsonData;
    } catch (err) {
      console.error(err.message);
    }
  };


  return (
    <div className="card" style={{ width: 288}}>
      <div className="card-body">
        <h5 className="card-title text-center">FILTERS</h5>
        <div className="card-text">
          {Object.keys(filters).map( key => (
              <div className="form-check" key={key}>
              <input className="form-check-input" type="radio" name="gridRadios" id="gridRadios2" value={filters[key]} onChange={handleClickRadio} />
                <label className="form-check-label" >
                {key}
              </label>
              </div>
            ))}
        </div>
      </div>
    </div>
  );
}
